INSERT INTO `information_description` (`information_id`, `language_id`, `title`, `description`) VALUES
(5, 1, 'Terms &amp; Conditions', '&lt;p&gt;&lt;tt&gt;PLEASE CAREFULLY REVIEW THE TERMS OF USE OF THIS SITE. As your use of the site will indicate your acceptance of these terms, do not use the site if you do not agree to be bound by these terms. We may periodically change the terms, so please check them from time to time as your continued use of the site signifies your acceptance of any changed items.&lt;br /&gt;\r\n&lt;br /&gt;\r\nCOPYRIGHT AND TRADEMARK. Unless otherwise noted, all materials on this site are protected as the copyrights, trade dress, trademarks and/or other intellectual properties owned by Rogers Family Company, Inc. (JBR Inc.) and/or its subsidiaries and affiliates or by other parties that have licensed their material to the Rogers Family Company, Inc. (JBR Inc.)&lt;br /&gt;\r\n&lt;br /&gt;\r\nRogers Family Company, Inc. (JBR Inc.) marks on this site represent some of the marks currently owned or controlled in the United States and/or in one or more other countries by Rogers Family Company, Inc. (JBR Inc.) or Rogers Family Company, Inc. (JBR Inc.) U.S. Brands Corporation under license to Rogers Family Company, Inc. (JBR Inc.). The display of these marks and of notices associated with these marks is not intended to be a comprehensive compilation of all Rogers Family Company, Inc. (JBR Inc.) worldwide proprietary ownership rights, and Rogers Family Company, Inc. (JBR Inc.) may own or control other proprietary rights in one or more countries outside of the United States. All rights not expressly granted are reserved.&lt;br /&gt;\r\n&lt;br /&gt;\r\nFEEDBACK AND SUBMISSIONS. You agree you are and shall remain solely responsible for the contents of any submissions you make, and you will not submit material that is unlawful, defamatory, abusive or obscene. You agree that you will not submit anything to the site that will violate any right of any third party, including copyright, trademark, privacy or other personal or proprietary right(s).&lt;br /&gt;\r\n&lt;br /&gt;\r\nWhile we appreciate your interest in Rogers Family Company, Inc. (JBR Inc.), we do not want and cannot accept any ideas you consider to be proprietary regarding designs, product technology or other suggestions you may have developed. Consequently, any material you submit to this site will be deemed a grant of a royalty free non-exclusive right and license to use, reproduce, modify, display, transmit, adapt, publish, translate, create derivative works from and distribute these materials throughout the universe in any medium and through any methods of distribution, transmission and display whether now known or hereafter devised. In addition, you warrant that all so-called &quot;moral rights&quot; have been waived.&lt;br /&gt;\r\n&lt;br /&gt;\r\nPERSONAL USE. Your use of the materials included on this site is for informational and shopping purposes only. You agree you will not distribute, publish, transmit, modify, display or create derivative works from or exploit the contents of this site in any way. You agree to indemnify, defend and hold harmless Rogers Family Company, Inc. (JBR Inc.) for any and all unauthorized uses you may make of any material on the site. You acknowledge the unauthorized use of the contents could cause irreparable harm to Rogers Family Company, Inc. (JBR Inc.) and that in the event of an unauthorized use, Rogers Family Company, Inc. (JBR Inc.) shall be entitled to an injunction in addition to any other remedies available at law or in equity.&lt;br /&gt;\r\n&lt;br /&gt;\r\nPRODUCT SALES AND AVAILABILITY. All products displayed on this site will be delivered only within the United States. All prices displayed on the site are quoted in U.S. Dollars and are valid and effective only in the United States. All prices displayed on the site are quoted in U.S. Dollars. Rogers Family Company, Inc. (JBR Inc.) reserves the right without prior notice to discontinue or change specifications on products and services offered on this site without incurring any obligations.&lt;br /&gt;\r\n&lt;br /&gt;\r\nLINKS. Some links on the site will allow you to connect with sites that are not under our control. Rogers Family Company, Inc. (JBR Inc.) is providing these links only as a convenience. The appearance of a link does not imply Rogers Family Company, Inc. (JBR Inc.) endorsement, nor is Rogers Family Company, Inc. (JBR Inc.) responsible for the contents of any linked site. You access them at your own risk.&lt;br /&gt;\r\n&lt;br /&gt;\r\nPRIVACY &amp;amp; SECURITY. For an explanation of Rogers Family Company, Inc. (JBR Inc.) policy related to the collection, use and storage of our online customers'' information, please read our &lt;a href=&quot;http://petacoffee.com/help.php?section=business&quot;&gt;Privacy Policy&lt;/a&gt;. For information about the security of your ordering information and credit card number while shopping on Rogers Family Company, Inc. (JBR Inc.)Ã¢â‚¬â„¢s www.petacoffee.com website please refer also to our &lt;a href=&quot;http://petacoffee.com/help.php?section=business&quot;&gt;Privacy Policy&lt;/a&gt;.&lt;br /&gt;\r\n&lt;br /&gt;\r\nDISCLAIMER. EXCEPT AS OTHERWISE EXPRESSLY STATED WITH RESPECT TO OUR PRODUCTS, ALL CONTENTS OF THE SITE ARE OFFERED ON AN &quot;AS IS&quot; BASIS WITHOUT ANY WARRANTY WHATSOEVER EITHER EXPRESSED OR IMPLIED.&lt;br /&gt;\r\n&lt;br /&gt;\r\nRogers Family Company, Inc. (JBR Inc.) does not guarantee that the functions contained in the site will be uninterrupted or error-free, that this site or its server will be free of viruses or other harmful components, or that defects will be corrected even if Rogers Family Company, Inc. (JBR Inc.) is aware of them.&lt;br /&gt;\r\n&lt;br /&gt;\r\nMINORS. Rogers Family Company, Inc. (JBR Inc.) asks that parents supervise their children while online. No information should be posted by minor children without parental consent.&lt;br /&gt;\r\n&lt;br /&gt;\r\nJURISDICTIONAL. Any dispute arising from these terms shall be resolved exclusively in the state and federal courts of the State of California. Rogers Family Company, Inc. (JBR Inc.) makes no representation that materials in this site are appropriate or available for use in other locations. If you access this site from outside the United States, be advised this site may contain references to products and services that are not available or are prohibited in your country.&lt;br /&gt;\r\n&lt;br /&gt;\r\nWE MAKE REASONABLE EFFORTS TO PROVIDE ACCURATE AND TIMELY INFORMATION ABOUT ROGERS FAMILY COMPANY INC. (JBR INC.) ON THIS SITE. HOWEVER, YOU SHOULD NOT ASSUME THAT THE INFORMATION PROVIDED IS ALWAYS UP TO DATE OR THAT THIS SITE CONTAINS ALL THE RELEVANT INFORMATION AVAILABLE ABOUT US. &lt;/tt&gt;&lt;/p&gt;\r\n'),
(3, 1, 'Privacy Policy', '&lt;p&gt;Welcome to the PETA Cruelty-Free Coffee at www.petacoffee.com - a gourmet coffee market specifically for PETA. Your trust in us is of paramount importance. A large part of that trust involves our protection of your private information. In this privacy and security statement, we have provided what we hope is a clear and easy to understand policy on your information and how we use and protect it.&lt;/p&gt;\r\n\r\n&lt;h4&gt;Information We Collect&lt;/h4&gt;\r\n\r\n&lt;p&gt;When you purchase an online product from one of our online stores, we do ask you to create an account with us -- this account holds your account login and password as well as your email address, phone, shipping, billing address, and credit card information if you''re ordering online. We do use cookies to allow us to maintain products in your shopping carts while you are shopping online. This cookie is a small text file stored on your computer that holds no personal information -- rather it simply indicates that someone on your computer is currently, or has in the past, visited our site.&lt;/p&gt;\r\n\r\n&lt;h4&gt;How We Use the Data We Collect&lt;/h4&gt;\r\n\r\n&lt;p&gt;We use your data for transactional information only. We do not use it for marketing purposes, and we will never sell, rent, or otherwise provide your data to a third party.&lt;/p&gt;\r\n\r\n&lt;h4&gt;Secure Online Ordering&lt;/h4&gt;\r\n\r\n&lt;p&gt;When you place an order with us, your personal and credit card information is encrypted during transmission through 128 bit, Secure Socket Layer (SSL). You know when you are using a secure site because the URL address will contain the letters,&lt;/p&gt;\r\n'),
(6, 1, 'Delivery Information', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;DialogBox&quot; valign=&quot;top&quot;&gt;\r\n&lt;h2&gt;PETA Cruelty-Free Coffee Shipping Policy&lt;/h2&gt;\r\nWelcome to PETA Cruelty-Free Coffee shipping policy information page where you''ll find information about our handling time, Free/Discounted Shipping for UPS Ground policy, transit time information, and our policy for PO boxes, military shipments, Alaska/Hawaii (zone), and international shipments.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;4-Day Handling Time Policy&lt;/b&gt;&lt;br /&gt;\r\nWe have a 4 business day handling time policy before shipping. So once you place your order, it may not ship until 4 business days later (but often ships sooner). If you order on or around one of our company holidays, the total days before shipping may take longer simply because the holiday is not a business day. Please see our holiday list at the bottom of this page. (Note: Saturday and Sunday are not considered as business days.)&lt;br /&gt;\r\n&lt;br /&gt;\r\nIf you''re using Free Shipping/UPS Ground methods, transit times vary from our Northern California location. Check the UPS Ground chart below for the approximate times.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Free/Discounted Shipping $50 or More&lt;/strong&gt;&lt;br /&gt;\r\nWe offer free, standard &lt;strong&gt;UPS Ground&lt;/strong&gt; shipping for orders totaling $50.00 or more, AFTER coupons and discounts. (This excludes shipments to Alaska, Hawaii, Guam, Puerto Rico, U.S. Virgin Islands, and regular international shipments.)&lt;br /&gt;\r\n&lt;br /&gt;\r\nIf you''d like to setup your order with a shipping method other than UPS Ground, or if your order is under $50, you''ll incur the standard UPS shipping rates.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Shipments to Alaska/Hawaii Zone&lt;/b&gt;&lt;br /&gt;\r\nAll orders to Alaska, Hawaii, Guam, Puerto Rico, and the U.S. Virgin Islands will be shipped via USPS Priority Mail only and will not include a tracking number. For orders $65 or more AFTER all coupons and discounts, we''ll apply a flat rate, per pound surcharge in which now adheres to USPS prices. &lt;b&gt;NEW!&lt;/b&gt; For orders weighing 6 pounds or less &lt;u&gt;and&lt;/u&gt; under $65 AFTER all coupons and discounts, we offer a $14.99 flat rate shipping option via USPS. Any order outside of these parameters (i.e. over 6 pounds and under $65 AFTER all coupons/discounts) will incur standard UPS rates.&lt;br /&gt;\r\n&lt;br /&gt;\r\nIf you would like to ship via USPS Express Mail to this zone, please contact us immediately at 1-800-829-1300 or peta_service@rogersfamilyco.com.\r\n&lt;p align=&quot;left&quot;&gt;&lt;a href=&quot;http://petacoffee.com/files/images/ups_ground_map_big.jpg&quot; target=&quot;_blank&quot;&gt;&lt;img align=&quot;left&quot; alt=&quot;Click on map to enlarge&quot; height=&quot;250&quot; src=&quot;http://petacoffee.com/files/images/ups_ground_map_small.jpg&quot; vspace=&quot;4&quot; width=&quot;300&quot; /&gt;&lt;/a&gt;&lt;br /&gt;\r\n&lt;strong&gt;APO and FPO Customers&lt;/strong&gt; - We now process orders to military APO or FPO boxes! We will ship them via USPS Priority Mail, thus, no tracking number will be included. Shipping is free to any APO or FPO address regardless of the order total. Please note, we cannot ship overnight or express mail for APO or FPO boxes.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Regular International Orders&lt;/strong&gt; – We do not process regular international shipments, but we welcome your order over the phone or email. Our “Free/Discounted Shipping $50 or More” policy does &lt;u&gt;not&lt;/u&gt; apply. For quotes on international order shipments, please contact us at 1-800-829-1300 or email peta_service@rogersfamilyco.com.&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Shipping to a PO box? - &lt;/strong&gt;We only ship to these locations using USPS; however we charge you UPS Ground rates shown on the website (including the Free/Discounted Shipping $50 or More method) during checkout. We cannot ship overnight or express mail if you provide a PO box, and these orders will not receive a tracking number.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Transit Times&lt;/strong&gt;&lt;br /&gt;\r\nPlease see the UPS Ground Transit Times map for an estimate of when you can expect your shipment for UPS Ground shipments. The times are estimated from our roasting facility in Lincoln, CA.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Shipping and Holidays&lt;/strong&gt;&lt;br /&gt;\r\nWhen you place an order, we will process that order and charge your credit card either that same day or the following work day. Then the order will typically ship within 4 business days after it is processed and charged.&lt;br /&gt;\r\n&lt;br /&gt;\r\nOur holidays are shown below. Any orders placed on a holiday will be processed on the first business day after the holiday. The order will be shipped as soon as possible after it''s processed. Our holidays are:\r\n&lt;ul&gt;\r\n	&lt;li&gt;New Year''s Day (1/1/13)&lt;/li&gt;\r\n	&lt;li&gt;President''s Day (2/18/13)&lt;/li&gt;\r\n	&lt;li&gt;Memorial Day (5/27/13)&lt;/li&gt;\r\n	&lt;li&gt;Independence Day (7/4/13)&lt;/li&gt;\r\n	&lt;li&gt;Labor Day (9/2/13)&lt;/li&gt;\r\n	&lt;li&gt;Thanksgiving Day (11/28/13)&lt;/li&gt;\r\n	&lt;li&gt;Day After Thanksgiving (11/29/13)&lt;/li&gt;\r\n	&lt;li&gt;Christmas Eve Day (12/24/13)&lt;/li&gt;\r\n	&lt;li&gt;Christmas Day (12/25/13)&lt;/li&gt;\r\n	&lt;li&gt;New Year''s Eve (12/31/13)&lt;/li&gt;\r\n	&lt;li&gt;New Year''s Day (1/1/14)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;/div&gt;\r\n'),
(4, 1, 'About Us', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://72.32.35.132/image/data/coffee_roaster.jpg&quot; style=&quot;width: 250px; height: 167px; float: right;&quot; /&gt;PETA Cruelty Free Coffee is imported, roasted, and fulfilled by our roaster partner who has the highest sustainability and ethical standards - both for people and animals. They''ve been roasting coffee for over 25 years, trade fairly by purchasing directly from farmers at set prices, and run economic and agricultural development projects on the farms where they import their coffee. They even have their own organic coffee farm in Panama.&lt;br /&gt;\r\n&lt;br /&gt;\r\nYou''ll find that PETA Coffee is the most delicious you''ve ever tried! Our coffee is rich, full bodied, full of character, and never bitter.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;It''s grown at high altitudes over 3000 feet. (The best coffee is grown in the high mountains in the tropics.)&lt;/li&gt;\r\n	&lt;li&gt;It''s 100% Arabica (as opposed to the bland Robusta coffee from which other roasters make instant coffee).&lt;/li&gt;\r\n	&lt;li&gt;It''s 100% USDA organic certified by OCIA.&lt;/li&gt;\r\n	&lt;li&gt;It''s shade-grown on tropical, highland rainforests of Central America. (Shade-grown coffee is grown in and amongst the forest canopy - maintaining animal habitats and rainforests themselves.)&lt;/li&gt;\r\n	&lt;li&gt;It''s Beast of Burden Free. This means no animals were used in the farming or harvesting of these coffee beans.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Our roaster combines age-old artistry with modern technology to achieve a perfect roast each and every time. Their roasts technique varies by type of bean, time of year, temperature, and weather.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;&lt;u&gt;The Roasts:&lt;/u&gt;&lt;/strong&gt;&lt;br /&gt;\r\nThe two roasts used for PETA Coffees are Regular and French Roast.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Regular (Full-City):&lt;/strong&gt; The standard roast. Develops the beans to their fullest flavor point. Full-bodied, slightly sweet, well-rounded.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;French Roast:&lt;/strong&gt;The “West Coast Roast”. Roasted past the pop and sizzle, until the beans are very dark brown and very oily. Intense coffee and smoky flavors.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;&lt;u&gt;Freshness Locked-in&lt;/u&gt;&lt;/b&gt;&lt;br /&gt;\r\nOne of the most important steps in controlling coffee quality is packaging the coffee quickly after roasting so that it doesn''t go stale with exposure to oxygen.&lt;br /&gt;\r\n&lt;br /&gt;\r\nOur roaster seals the coffee away from the harmful effects of the air within minutes of roasting while the coffee is still warm, whereas most coffee roasters let their coffee &quot;gas-off&quot; over a period of hours (or sometimes days) before packaging it. The coffee typically has less than 1% oxygen in the packages, with the natural gassing-off process occurring through the one-way valve packaging that lets gasses out, but locks freshness in.&lt;/p&gt;\r\n'),
(7, 1, 'What''s New', '&lt;p&gt;Welcome to our new online store for PETA Coffee. We''ve implemented a number of great new features - while offering the same delicious, cruelty-free coffee you''ve grown to love over the years.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;2-pound Value Size bags now available!&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;&lt;a href=&quot;http://petacoffee.com/help.php?section=shipping&quot;&gt;USPS Priority Mail&lt;/a&gt; shipping to Alaska, Guam, Hawaii, Puerto Rico, U.S. Virgin Islands.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=12&quot;&gt;PETA Coffee Club program!&lt;/a&gt; - Never run out of coffee again with our automatic shipments coffee club. Choose your coffee, choose your frequency, and receive free UPS Ground shipping on your first order &lt;font size=&quot;-2&quot;&gt;(excludes AK/HI)&lt;/font&gt;! Then manage your recurring order right here on our website!&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Not quite ready to join the Club? Then use &quot;&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=15&quot;&gt;Recaffeinate&lt;/a&gt;!&quot; It''s an easy re-order capability from your past orders. You must be logged in first to use this tool.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Address Book - Enjoy the convenience of storing multiple addresses in your account while using it during checkout or for your recurring order.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=23&quot;&gt;Loyalty Points!&lt;/a&gt; Accumulate 1 point for each dollar you spend at our store, and redeem them at a 40:1 ratio for coffee, coffee accessories, and gift baskets.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;&lt;a href=&quot;http://petacoffee.com/crp_referral.php&quot;&gt;Refer a Friend program!&lt;/a&gt; - Refer your friends, family, or co-workers to our online store using our online referral form. (You must be logged in first to refer friends.) Earn 50 points for each friend who subsequently makes a purchase at our store.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Streamlined checkout functionality.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Larger product photos with roast level meters.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;&lt;a href=&quot;http://petacoffee.com/giftcert.php&quot;&gt;Buy online gift certificates.&lt;/a&gt;&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Product ratings and reviews.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;More &lt;a href=&quot;http://petacoffee.com/home.php?cat=1&quot;&gt;coffee &amp;amp; tea accessories such as mugs, grinders, and filters.&lt;/a&gt;&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Real-time UPS shipping rates (for expedited shipping too), Free shipping $65+; Flat Rate $5.99 for $45 -$64.99. &lt;font size=&quot;-2&quot;&gt;(excludes AK/HI)&lt;/font&gt;.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=20&quot;&gt;Discount coupon codes for orders of $120 or more.&lt;/a&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(8, 1, 'PETA Coffee Club', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://72.32.35.132/image/data/peta_coffee_club_logo.jpg&quot; style=&quot;width: 342px; height: 120px; float: left; margin-right:20px; margin-bottom:20px;&quot; /&gt;200 loyalty points for signing up!&lt;br /&gt;\r\n5% discount on all orders!&lt;br /&gt;\r\nNever run out of coffee!&lt;/p&gt;\r\n\r\n&lt;p style=&quot;clear:both&quot;&gt;Wouldn''t it be great if you could get the coffee you love, automatically, when you want it? Wouldn''t it be great to never run out of coffee again? Well now with our new PETA Coffee Club program, you''ll enjoy the convenience of automatic shipments so you''ll never run out of coffee or make a last minute trip to the supermarket for your caffeine fix!&lt;br /&gt;\r\n&lt;br /&gt;\r\nYou''ll get your favorite coffees or teas every 2 weeks, 4 weeks, 6 weeks, 8 weeks...or more....your choice!&lt;br /&gt;\r\n&lt;br /&gt;\r\nChoose any selection of our coffees and teas to start with, but you can always change your recurring order at any time to any product in our online store (except accessories and gift baskets).&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;The Perks:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;font color=&quot;red&quot;&gt;NEW!&lt;/font&gt; Free UPS Ground shipping on your first recurring order! &lt;font size=&quot;-2&quot;&gt;(AK/HI excluded)&lt;/font&gt;&lt;/li&gt;\r\n	&lt;li&gt;Our &lt;a href=&quot;http://petacoffee.com/help.php?section=shipping&quot;&gt;Free/Discounted UPS Ground shipping policy&lt;/a&gt; applies for all subsequent orders.&lt;/li&gt;\r\n	&lt;li&gt;An additional 200 loyalty points, also with your first order!&lt;/li&gt;\r\n	&lt;li&gt;You''ll get 5% off all ongoing recurring orders just for being in the club.&lt;/li&gt;\r\n	&lt;li&gt;Loyalty points earned for each automatic order!&lt;/li&gt;\r\n	&lt;li&gt;All high dollar value discounts can be applied as well as other coupon codes (except 1-time-use).&lt;/li&gt;\r\n	&lt;li&gt;Cancel at any time.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;These are just a few of the many reasons to join PETA Coffee Club today!&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Joining PETA Coffee Club is so easy! &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Simply shop for the items you want.&lt;/li&gt;\r\n	&lt;li&gt;Add them to your cart.&lt;/li&gt;\r\n	&lt;li&gt;Before pressing the &quot;Checkout&quot; button, choose, &quot;Yes, I want to set up a recurring order.&quot;&lt;/li&gt;\r\n	&lt;li&gt;Choose the frequency for your automatic shipment (2 weeks, 4 weeks, etc.)&lt;/li&gt;\r\n	&lt;li&gt;Sit back and let us do the rest!&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;With your first order, you''ll get an instant addition of 200 reward points for signing up. You''ll get 5% off ongoing orders. You''ll get loyalty points for each automatic order good for any coffee, tea, or accessory in our store. And finally, you''ll get the peace of mind knowing you''ll never run out of coffee again.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Want to change your order or cancel? No problem!&lt;/strong&gt;&lt;br /&gt;\r\nSimply manage your recurring order right here on our website from the &lt;strong&gt;&lt;a href=&quot;http://petacoffee.com/recurring_orders.php&quot;&gt;Recurring Orders&lt;/a&gt;&lt;/strong&gt; link in the &quot;Your Cart&quot; box in the upper right hand side of our home page. This link is enabled once you join the club.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;You can change your credit card or expiration date.&lt;/li&gt;\r\n	&lt;li&gt;You can change quantities, delete or add products on your automatic order.&lt;/li&gt;\r\n	&lt;li&gt;You can also put it on vacation hold (make it inactive).&lt;/li&gt;\r\n	&lt;li&gt;You can cancel (make it inactive) it at any time.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;Ready to Sign Up?&lt;/strong&gt;&lt;br /&gt;\r\nThen go ahead and shop for the items you want to be automatically shipped to you. During checkout, choose the &quot;Yes, I want to set up a recurring order&quot; and choose your frequency. Then leave the rest to us!&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Want to Learn More?&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nVisit our &lt;a href=&quot;http://petacoffee.com/pages.php?pageid=34&quot;&gt;PETA Coffee Club &quot;How it Works&quot;&lt;/a&gt; page to learn more about how the club works.&lt;/p&gt;\r\n'),
(9, 1, 'PETA Coffee Club - How it Works', '&lt;div class=&quot;DialogBox&quot; valign=&quot;top&quot;&gt;&lt;b&gt;With our new PETA Coffee Club...&lt;/b&gt;\r\n&lt;ol&gt;\r\n	&lt;li&gt;You now have the option to set up an order on a recurring basis in your shopping cart.\r\n	&lt;ul&gt;\r\n		&lt;li&gt;That option is not available if the order includes an ineligible product such as an accessory or gift basket.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;If interested in joining the PETA Coffee Club, please select the option, “Yes, I want to set this as a recurring order”.\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Choose a frequency (in weeks) for your recurring order&lt;/li&gt;\r\n		&lt;li&gt;Verify that the Recurring Order discount has been applied to your total&lt;/li&gt;\r\n		&lt;li&gt;Coupon codes: the system does &lt;u&gt;not&lt;/u&gt; accept 1-time use coupon codes.&lt;/li&gt;\r\n		&lt;li&gt;Proceed to the Checkout process&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Recurring Orders can only be shipped via UPS Ground (or &quot;Free/Discounted UPS Ground&quot; if applicable)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;All subsequent orders will also be shipped using this method.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Only credit cards are accepted for payment of Recurring Orders. Gift Certificates or Points &lt;u&gt;cannot&lt;/u&gt; be used for payment.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Please verify the following before submitting your recurring order:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;the items in your order&lt;/li&gt;\r\n		&lt;li&gt;the billing &amp;amp; shipping addresses&lt;/li&gt;\r\n		&lt;li&gt;the order total&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;After submitting your order, you''ll receive an order confirmation, and your 200 points will be posted to your account. (You can view your points balance in your user profile page.) Your next order will be created exactly the number of weeks after your first order date that you have picked for the frequency of your recurring order. At that time, the order will be shipped within 3-4 days and will be shipped via UPS Ground for arrival 5-7 business days later.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;b&gt;Managing your Recurring Order:&lt;/b&gt;&lt;img align=&quot;right&quot; alt=&quot;Edit Recurring Orders&quot; src=&quot;http://petacoffee.com/files/images/edit_recurring_orders_peta.jpg&quot; /&gt;\r\n&lt;ol&gt;\r\n	&lt;li&gt;Once you have created a recurring order, you can manage it under the &lt;i&gt;&lt;a href=&quot;http://petacoffee.com/recurring_orders.php&quot;&gt;Recurring Orders&lt;/a&gt;&lt;/i&gt; link in the &quot;Your Cart&quot; box. (See image)\r\n\r\n	&lt;ul&gt;\r\n		&lt;li&gt;You must be signed-in to your account AND you must have a recurring order setup in order to see this option&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Select your recurring order (#) from list to view\r\n	&lt;ul&gt;\r\n		&lt;li&gt;From there, you will see a summary of your recurring order&lt;/li&gt;\r\n		&lt;li&gt;Select the &lt;i&gt;&lt;b&gt;Add-Remove Products | Edit Product Details | Add Coupon Code&lt;/b&gt;&lt;/i&gt; tab to...\r\n		&lt;ul style=&quot;list-style-type:disc|circle|square|none&quot;&gt;\r\n			&lt;li&gt;Edit your product options such as quantity, size, whole bean or ground&lt;/li&gt;\r\n			&lt;li&gt;Add a product to your recurring order&lt;/li&gt;\r\n			&lt;li&gt;Delete a product from your recurring order&lt;/li&gt;\r\n			&lt;li&gt;Apply a valid coupon code to your recurring order&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n		&lt;/li&gt;\r\n		&lt;br /&gt;\r\n		&lt;li&gt;Select the &lt;i&gt;&lt;b&gt;Change Order Status | Adjust Order Frequency | Add Order Notes | Edit Billing-Shipping Addresses | Update Payment Details&lt;/b&gt;&lt;/i&gt; tab to...\r\n		&lt;ul style=&quot;list-style-type:disc|circle|square|none&quot;&gt;\r\n			&lt;li&gt;Change the frequency of your recurring order&lt;/li&gt;\r\n			&lt;li&gt;Hold or cancel your recurring order by setting the status to &quot;Inactive&quot;&lt;/li&gt;\r\n			&lt;li&gt;Update your credit card information on file&lt;/li&gt;\r\n			&lt;li&gt;Update your billing/shipping addresses&lt;/li&gt;\r\n			&lt;li&gt;Edit, add, remove any order notes&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n		&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Please remember to update and then &lt;u&gt;SAVE&lt;/u&gt; all changes for them to be applied to your recurring order.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;/div&gt;\r\n'),
(10, 1, 'Loyalty Points', '&lt;p&gt;We have implemented a Loyalty Points system that rewards our valued repeat customers!&lt;br /&gt;\r\n&lt;br /&gt;\r\nHere''s how it works.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Earning Points&lt;/b&gt;&lt;br /&gt;\r\nIt''s fairly simple: everyone earns one point for each dollar they spend at our store. Please note that we do not round up, so for instance, if your order totals $29.99, you will get 29 points not 30. Points are only redeemable for products in our www.petacoffee.com online store. They are not redeemable for cash.&lt;br /&gt;\r\n&lt;br /&gt;\r\nYou do not earn points for the following:&lt;br /&gt;\r\n1) any orders placed BEFORE 03/04/09. Points only apply on an ongoing basis from the date we went live with the PETA Cruelty-Free Coffee (www.petacoffee.com) website and the points incentive program we started at that time.&lt;br /&gt;\r\n2) shipping fees,&lt;br /&gt;\r\n3) taxes,&lt;br /&gt;\r\n4) orders where you buy a gift certificate,&lt;br /&gt;\r\n5) orders where you pay with a gift certificate,&lt;br /&gt;\r\n6) orders where you pay with points or any partial points used,&lt;br /&gt;\r\n7) dollar value of discounts (such as coupons discounts or high $ value discounts).&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/crp_referral.php&quot;&gt;Refer a Friend&lt;/a&gt; and receive even more points! Start referring family and friends by using &lt;a href=&quot;http://petacoffee.com/crp_referral.php&quot;&gt; the Referral Form&lt;/a&gt;.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Viewing Total Points in Your Account&lt;/b&gt;&lt;br /&gt;\r\nYour points total is stored in your Account Profile. Access your profile by logging into the store using the &quot;Returning Customer Sign In&quot; tab. Once you have logged in, click on &quot;Modify Profile&quot; under the &lt;i&gt;Your Cart&lt;/i&gt; box (on the upper right hand side of the screen).&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Getting Stuff with Points!&lt;/b&gt;&lt;br /&gt;\r\n1) For all regular (non-recurring) orders, you can redeem your points for any product in our store (including shipping and taxes in your order) at a 40 points to $1 value. So, for instance, if you have 200 points, you can apply them to $5 off your order total.&lt;br /&gt;\r\n&lt;br /&gt;\r\n2) You can redeem your points at any time to achieve a partial discount on your non-recurring order total.&lt;br /&gt;\r\n&lt;br /&gt;\r\n3) To use your points, add your items to your cart, and then click checkout. When you reach the &quot;Payment Method&quot; section, choose, &quot;Pay With Points.&quot;&lt;br /&gt;\r\n&lt;br /&gt;\r\n4) The system will show you how many points you have and will prompt you for how many points you want to use. If you want to use partial points, enter that number; otherwise, enter the total amount of points you have. Remember, the ratio is 40 points to 1 dollar.&lt;br /&gt;\r\n&lt;br /&gt;\r\n5) If you use your points to pay a partial balance, you will need to pay the remainder with a credit card. The shopping cart will prompt you again for a Payment Method for the balance. The details of the breakdown will be shown in your confirmation invoice.&lt;br /&gt;\r\n&lt;br /&gt;\r\nWe hope you enjoy our Loyalty Points program!&lt;/p&gt;\r\n'),
(11, 1, 'Recaffeinate', '&lt;p&gt;&lt;b&gt;Recaffeinate - Reorder your last order!&lt;/b&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nWe''ve made it easier to re-order the same products you last ordered.&lt;br /&gt;\r\n&lt;br /&gt;\r\nHere''s how:&lt;br /&gt;\r\n&lt;br /&gt;\r\n1) Click the button &quot;Recaffeinate&quot; at the top of the screen.&lt;br /&gt;\r\n2) Log in using your username and password.&lt;br /&gt;\r\n3) Search using the search feature for the order you would like to repeat.&lt;br /&gt;\r\n4) Click on the order number to view the last order.&lt;br /&gt;\r\n5) Click the link at the top of the page, &quot;Add order to cart.&quot;&lt;br /&gt;\r\n6) Check out as normal.&lt;br /&gt;\r\n&lt;br /&gt;\r\nEnjoy easy re-ordering each time you return!&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n'),
(12, 1, 'High $ Value Discounts', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://72.32.35.132/image/data/high_dollar_value.gif&quot; style=&quot;width: 114px; height: 120px; float: left;&quot; /&gt;We offer discount coupon codes for the following dollar thresholds:&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;5% off $120 with coupon code &lt;b&gt;5HDV&lt;/b&gt;&lt;/li&gt;\r\n	&lt;li&gt;10% off $160 with coupon code&lt;b&gt; 10HDV&lt;/b&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;To use the coupon, on the Cart page, click on the &quot;Enter Coupon Code&quot; yellow button. Then enter the code and be sure to submit it before you press the &quot;Checkout&quot; button. Enjoy!&lt;/p&gt;\r\n'),
(13, 1, 'About Caffeine and Decaffeination', '&lt;p&gt;Caffeine is a mild natural stimulant that is found in many plant species. Its function in the plant is to serve as a natural pesticide for certain insects that are enemies of the plant. As far as human consumption is concerned, caffeine has many sources, including chocolate, tea, and, of course, coffee. In the US, almost 90% of Americans consume caffeine daily.&lt;/p&gt;\r\n\r\n&lt;p&gt;All coffees naturally contain caffeine. However, gourmet Arabica coffee beans, such as we use exclusively, contain 40% to 50% less caffeine than the harsher, more common Robusta beans, which are used in commercial canned coffees. Most Arabica coffees contain between 70 and 150 mg of caffeine per cup.&lt;/p&gt;\r\n\r\n&lt;p&gt;In addition, the longer you roast a coffee, the less caffeine remains. Our richer, darker roasts not only extract more flavor out of the bean, but reduce levels of caffeine, as well.&lt;/p&gt;\r\n\r\n&lt;p&gt;The federal government controls the caffeine levels in decaffeinated coffees, and in order for a coffee to be called &quot;Decaffeinated&quot; or &quot;Decaf&quot;, the green coffee beans must have undergone one of several decaffeinating processes to remove 97% of the caffeine resident in the bean.&lt;/p&gt;\r\n\r\n&lt;p&gt;Here at PETA Coffee, we roast exclusively Arabica beans, and our standard is to remove 98% or more of the caffeine during the decaffeination process.&lt;/p&gt;\r\n\r\n&lt;p&gt;Almost all methods basically involve soaking green, unroasted beans (which are really tropical evergreen seeds) in a liquid tank to precipitate out the caffeine. Some processes require an effort to re-inject lost flavor back into the beans. Then they are washed numerous times, dried, and bagged.&lt;/p&gt;\r\n\r\n&lt;p&gt;There are many decaffeinating processes, some using chemical solvents, some gases, and some only steam or water. The challenge here is to not only find a safe, effective decaffeination process, but one that yields a good tasting coffee.&lt;/p&gt;\r\n\r\n&lt;p&gt;We have discovered a natural process that uses only water, yet results in an excellent tasting coffee – something that is difficult to achieve with water process coffees. With this method, the green beans are soaked in a hot water bath, releasing the caffeine, and most of the natural flavors and oils. The water, containing at this point the main essences of the beans themselves (caffeine, flavors, and oils) is then transferred to another tank, where the caffeine is removed from the rest of the components via carbon filters. Then, the water, still containing the flavors and oils of the bean, is added back to the tank containing the beans, where the beans re-absorb their original oils and flavors, without the caffeine.&lt;/p&gt;\r\n\r\n&lt;div&gt;We are pleased to offer you the finest in decaffeinated coffees – all natural, water-processed, top quality Arabica beans, roasted longer for a fuller, richer taste, and vacuum-packed right out of the roaster for absolute freshness.&lt;/div&gt;\r\n'),
(14, 1, 'How to Brew Coffee', '&lt;p&gt;&lt;em&gt;&lt;strong&gt;Storing &amp;amp; Brewing Your Coffee&lt;/strong&gt;&lt;/em&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Storing Your Coffee&lt;/b&gt;&lt;br /&gt;\r\nStore your beans in an airtight container and grind them just prior to brewing. If you must store your beans for longer than a week, we suggest storing them in an airtight container in a dark cupboard.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Freshness&lt;/b&gt;&lt;br /&gt;\r\nStale coffee is bitter and the flavor is flat at best and rancid at worst. Staleness comes from exposure to air over a period of time, so the solution is to buy coffee from a source (like us!) that packages it in a vacuum-sealed bag while still warm from roasting.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Grinding&lt;/b&gt;&lt;br /&gt;\r\nGrinding is critical. Ground too coarse and you get weak coffee. Ground too fine and you get bitter coffee. The blade grinders that are sold in most stores do an adequate job. We suggest grinding for 10 to 12 seconds, and adjust that time to your taste. Proper grind is the key step in making coffee, so do it carefully.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Brewing&lt;/b&gt;&lt;br /&gt;\r\nTo get the best tasting drink, you should start with a ratio of two tablespoons of ground coffee per 6 ounces of water and adjust to your taste. Use the best possible water available. Tap water should be free of any strange flavors, odors or textures. If it is not, then use filtered or bottled water. Avoid distilled or softened water since some minerals are essential to coffee flavor. Tap water should be cold and allowed to run for a few seconds to aerate it before it goes into a maker or water kettle.&lt;br /&gt;\r\n&lt;br /&gt;\r\nWater should be heated to just below boiling (200 degrees F.). For drip brewers, the brew cycle should be completed in 4-6 minutes. Other good methods are the &quot;French Press&quot; and &quot;Vacuum pot&quot; which brew in about 4 minutes. Avoid percolators and electric pots with brew cycles that take longer than 6 minutes. These will over-extract the coffee and cause bitterness.&lt;br /&gt;\r\n&lt;br /&gt;\r\nServe brewed coffee within 30 minutes or store it in a &quot;thermal&quot; or insulated carafe. Coffee will remain fresh and tasty in this kind of container for 45 – 60 minutes. Coffee that has been left exposed to air or left on a hot burner deteriorates rapidly. To keep coffee warm, &quot;prime&quot; a thermal carafe by pre-filling it with hot water ahead of time, then emptying it of the warming water and filling it with the freshly made coffee. This method also works to warm up cold ceramic mugs.&lt;br /&gt;\r\n&lt;br /&gt;\r\nThere is no purpose in re-pouring or re-perking brewed coffee through spent grounds. Any desirable flavor elements have already been extracted. Only bitter oils remain. Re-heating brewed coffee -- even in a microwave -- breaks down coffee''s many delicate components, leaving only a warm beverage with a poor flavor.&lt;/p&gt;\r\n');
INSERT INTO `information_description` (`information_id`, `language_id`, `title`, `description`) VALUES
(15, 1, 'FAQ', '&lt;p&gt;&lt;b&gt;Address Book&lt;/b&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#address&quot;&gt;What is the Address Book and how does it work?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#multiple&quot;&gt;Can I ship to multiple addresses on one order?&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;PETA Coffee Club&lt;/b&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#javasign&quot;&gt;How do I sign-up for a recurring order?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#javaship&quot;&gt;Do I receive Free Shipping on each recurring order?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#javaman&quot;&gt;How can I make changes to my existing recurring order?&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Troubleshooting Account Sign-In&lt;/b&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#logacc&quot;&gt;I forgot my Username and/or Password to my account...&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#noacc&quot;&gt;I no longer have access to the e-mail on my account...&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#username&quot;&gt;Can I change my account login username and password?&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Loyalty Points&lt;/b&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#ropay&quot;&gt;Can I redeem my points on a recurring order?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#loyaltybal&quot;&gt;Where can I see my balance of loyalty points?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#loyaltypay&quot;&gt;How do I pay for an order using loyalty points?&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Repeat Your Last Order&lt;/b&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#recaffeinate&quot;&gt;How do I quickly repeat my last order using &quot;Recaffeinate&quot;?&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Orders &amp;amp; Shipping&lt;/b&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#shipment&quot;&gt;When can I expect shipment of my recently placed order?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#international&quot;&gt;Can I place an online order to be shipped to an international address?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#changes&quot;&gt;I want to make changes to my recently placed (online) order, how may I do so? &lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;High Value Discounts and Email Receipt Issues&lt;/b&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#discounts&quot;&gt;What are the discounts I can earn/receive?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#twocodes&quot;&gt;I have two coupon codes, may I apply both to an order?&lt;/a&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=28#email&quot;&gt;I’ve submitted online orders and inquiries, and requested account information, but have not received any emails from you.&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;address&quot;&gt;What is the Address Book and how does it work?&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;The Address Book allows you to store multiple addresses in your account.\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Once signed-in to your account, select the Address Book tab on right.&lt;/li&gt;\r\n		&lt;li&gt;Simply, select “Add Entry” to begin building your list.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Now, enjoy the convenience of instantly changing your ship-to address during checkout.\r\n	&lt;ul&gt;\r\n		&lt;li&gt;On the Shipping &amp;amp; Payment page, click the “Ship to a Different Address” tab on left.&lt;/li&gt;\r\n		&lt;li&gt;Select (or add a new) entry, and click “Ship to this Address &amp;amp; Return to Checkout”. (Please note: the new address will be saved to your account profile.)&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Recurring orders too!\r\n	&lt;ul&gt;\r\n		&lt;li&gt;If you have an active recurring order, you can modify your billing/shipping addresses using the Address Book on the Recurring Orders management pages. Please refer to the &quot;&lt;a href=&quot;http://petacoffee.com/pages.php?pageid=34&quot;&gt;PETA Coffee Club - How it Works&lt;/a&gt;&quot; page for more information.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;multiple&quot;&gt;Can I ship to multiple addresses on one order?&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Unfortunately, only (1) one address is accepted per order. We recommend placing separate orders for each address.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;javasign&quot;&gt;How do I sign-up for a recurring order?&lt;/a&gt;&lt;/b&gt;&lt;img align=&quot;right&quot; alt=&quot;Edit Recurring Orders&quot; src=&quot;http://petacoffee.com/files/images/edit_recurring_orders_peta.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;In your shopping cart, you will now have the option to set a particular order on a recurring basis (if all selected items are eligible for a recurring basis).&lt;/li&gt;\r\n	&lt;li&gt;If eligible, select the option, &quot;Yes, I want to set this as a recurring order&quot; and its frequency (in weeks) before checkout. This option is not available if you have ineligible items in your cart such as accessories or gift baskets.&lt;/li&gt;\r\n	&lt;li&gt;Please refer to our &lt;a href=&quot;http://petacoffee.com/pages.php?pageid=34&quot;&gt;PETA Coffee Club page&lt;/a&gt; for more details.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;javaship&quot;&gt;Do I receive Free Shipping on each recurring order?&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Regardless of the order total, Free UPS Ground shipping is included &lt;u&gt;only&lt;/u&gt; with the 1st recurring order. On all subsequent orders, freight charges will be assessed according to our &lt;a href=&quot;http://petacoffee.com/help.php?section=shipping&quot;&gt;Shipping Policy&lt;/a&gt;.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;javaman&quot;&gt;How can I make changes to my existing recurring order?&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;No need to call us! You can manage it online once you sign-in to your account.&lt;/li&gt;\r\n	&lt;li&gt;Click the &lt;b&gt;&quot;&lt;a href=&quot;http://petacoffee.com/recurring_orders.php&quot;&gt;Recurring Orders&lt;/a&gt;&quot;&lt;/b&gt; tab located on the upper right column of the page. (see image on right)&lt;/li&gt;\r\n	&lt;li&gt;Select the recurring order # from list to view.&lt;/li&gt;\r\n	&lt;li&gt;From there, you will see a summary of your recurring order.&lt;/li&gt;\r\n	&lt;li&gt;At the top of the page, select the action in its appropriate tab.&lt;/li&gt;\r\n	&lt;li&gt;Please refer to our &lt;a href=&quot;http://petacoffee.com/pages.php?pageid=34&quot;&gt;PETA Coffee Club page&lt;/a&gt; for more information.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;logacc&quot;&gt;I forgot my Username and/or Password to my account...&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;After failed attempts to log-in, click the &lt;b&gt;&quot;Recover Password&quot;&lt;/b&gt; button.&lt;/li&gt;\r\n	&lt;li&gt;Enter your valid e-mail address (the one you used for registration), and your account information will be mailed to you shortly.&lt;/li&gt;\r\n	&lt;li&gt;Please check your &quot;Spam&quot; folder and filtering options as it may not recognize our address, peta_service@rogersfamilyco.com. If this is the case, please add our email address to your address book.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;noacc&quot;&gt;I no longer have access to the e-mail on my account...&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Please contact us immediately at 1-800-829-1300 and/or email us at peta_service@rogersfamilyco.com to update your information.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;username&quot;&gt;Can I change my account login username and password?&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;The login username is the only field in an account that cannot be modified. If you would like a new username, we recommend creating a new account.&lt;/li&gt;\r\n	&lt;li&gt;Once logged-in, you can change your login password by selecting the &lt;i&gt;Modify Profile&lt;/i&gt; tab on the right-hand column.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;ropay&quot;&gt;Can I redeem my points on a recurring order?&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Unfortunately, the only payment method accepted for recurring orders is a credit card (Discover, American Express, Visa, or Mastercard).&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;loyaltybal&quot;&gt;Where can I see my balance of loyalty points?&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Your Loyalty Points balance is shown in your Profile.&lt;/li&gt;\r\n	&lt;li&gt;To find your profile, first you must log in.&lt;/li&gt;\r\n	&lt;li&gt;On the right side of the page under “Your Cart”, go to “Modify Profile”.&lt;/li&gt;\r\n	&lt;li&gt;Your available points total will appear at the top of your Profile page.&lt;/li&gt;\r\n	&lt;li&gt;Visit our &lt;a href=&quot;http://petacoffee.com/pages.php?pageid=23&quot;&gt;Loyalty Points Information Page&lt;/a&gt; to learn more about our Loyalty Points program.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;loyaltypay&quot;&gt;How do I redeem my Loyalty Points?&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;You can redeem your points for any product in our store (including shipping and taxes in your order) at a 40 points to $1 value. So, for instance, if you have 200 points, you can apply them to $5 off your order total. (Please note that points cannot be applied toward recurring orders.)&lt;/li&gt;\r\n	&lt;li&gt;You can redeem your points at any time to achieve a partial discount on your order total.&lt;/li&gt;\r\n	&lt;li&gt;To use your points, add your items to your cart, and then click checkout. When you reach the &quot;Payment Method&quot; section, choose, &quot;Pay With Points.&quot;&lt;/li&gt;\r\n	&lt;li&gt;The system will show you how many points you have and will prompt you for how many points you want to use. If you want to use partial points, enter that number, otherwise, enter the total amount of points you have. Remember, the ratio is 40 points to 1 dollar.&lt;/li&gt;\r\n	&lt;li&gt;If you use your points to pay a partial balance, you will need to pay the remainder with a credit card. The shopping cart will prompt you again for a Payment Method for the balance. The details of the breakdown will be shown in your confirmation invoice.&lt;/li&gt;\r\n	&lt;li&gt;Visit our &lt;a href=&quot;http://petacoffee.com/pages.php?pageid=23&quot;&gt;Loyalty Points Information Page&lt;/a&gt; to learn more about our Loyalty Points program.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;a name=&quot;recaffeinate&quot;&gt;&lt;b&gt;How do I quickly repeat my last order using &quot;Recaffeinate&quot;?&lt;/b&gt;&lt;/a&gt;&lt;br /&gt;\r\nRecaffeinate is a great time-saver that allows you to reorder a past order. To do so ...&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Find the &quot;Recaffeinate&quot; button in the upper, right-hand side of our website, and click this button.&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;If you''re not already in your account, you will be prompted to &quot;authenticate&quot; (login) with your username/password. (See following image.)&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;img align=&quot;middle&quot; alt=&quot;authenticate&quot; hspace=&quot;4&quot; src=&quot;http://petacoffee.com/files/images/authentication_peta.png&quot; /&gt;&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Use the date range search tool to see a list of all your past orders for the specified period. The easiest is just use the &quot;All Dates&quot; option, and click &quot;Search.&quot; (See following image.)&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;img align=&quot;middle&quot; alt=&quot;order search&quot; hspace=&quot;4&quot; src=&quot;http://petacoffee.com/files/images/order_management_peta.png&quot; /&gt;&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;From the resulting order history list, click on the order number of your last order. (See following image.)&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;img align=&quot;middle&quot; alt=&quot;click order number&quot; hspace=&quot;4&quot; src=&quot;http://petacoffee.com/files/images/recaffeinate_order_number_peta.png&quot; /&gt;&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Find the &lt;b&gt;&quot;Add Order to Cart&quot;&lt;/b&gt; link at the top of the page, and click the button. This will place the same products from your previous order into your shopping cart. (See following image.)&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;img align=&quot;middle&quot; alt=&quot;add order&quot; hspace=&quot;4&quot; src=&quot;http://petacoffee.com/files/images/recaffeinate_add_cart_peta2.png&quot; /&gt;&lt;/li&gt;\r\n	&lt;br /&gt;\r\n	&lt;li&gt;Check out as normal.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;a name=&quot;shipment&quot;&gt;&lt;b&gt;When can I expect shipment of my recently placed order?&lt;/b&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;After submitting an online order, please allow up to 4 business days for processing until shipment.&lt;/li&gt;\r\n	&lt;li&gt;UPS usually takes 3-7 business days to deliver packages from our Lincoln, California location, depending on its destination.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;a name=&quot;international&quot;&gt;&lt;b&gt;Can I place an online order to be shipped to an international address?&lt;/b&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;We do not process international shipments. However, we welcome your order over the phone, 1-800-829-1300 or email, &lt;a href=&quot;mailto:peta_service@rogersfamilyco.com&quot;&gt;peta_service@rogersfamilyco.com&lt;/a&gt;.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;a name=&quot;changes&quot;&gt;&lt;b&gt;I want to make changes to my recently placed (online) order, how may I do so?&lt;/b&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Once an online order is submitted, it cannot be modified. We recommend placing a new order with the changes while we cancel the previous one.&lt;/li&gt;\r\n	&lt;li&gt;Please call our Customer Service Group immediately at 1-800-829-1300 with this concern. Our business hours are from 8am - 4:30pm PST, Monday to Friday (except holidays).&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;discounts&quot;&gt;What are the discounts I can earn/receive? &lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;You are entitled to Free UPS Ground Shipping when you purchase $50 or more (some restrictions apply). For more information, please refer to our &lt;a href=&quot;http://petacoffee.com/help.php?section=shipping&quot;&gt;Shipping Policy.&lt;/a&gt;&lt;/li&gt;\r\n	&lt;li&gt;We offer High $ Value Discounts coupons on the following thresholds:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;5% for orders $120 to $159.99&lt;/li&gt;\r\n		&lt;li&gt;10% off for orders $160 or more&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	Please refer to our &lt;a href=&quot;http://petacoffee.com/pages.php?pageid=20&quot;&gt;High $ Value Discounts page&lt;/a&gt; to apply the discounts to your order.&lt;/li&gt;\r\n	&lt;li&gt;On top of it all, you receive one Loyalty Point for each dollar you spend at our store. See more details on &lt;a href=&quot;http://petacoffee.com/pages.php?pageid=23&quot;&gt;Loyalty Points page&lt;/a&gt;.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;b&gt;&lt;a name=&quot;twocodes&quot;&gt;I have two coupon codes, may I apply both to an order? &lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Unfortunately, only &lt;u&gt;one&lt;/u&gt; coupon code can be applied per order.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;a name=&quot;email&quot;&gt;&lt;b&gt;I’ve submitted online orders and inquiries, and requested account information, but have not received any emails from you.&lt;/b&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Your inbox may not recognize our email address under specific settings.&lt;/li&gt;\r\n	&lt;li&gt;Check your “Spam” folder as it may have been redirected there.&amp;nbsp;&lt;br /&gt;\r\n	If so, consider adding our email address to your email address book which will often solve this problem.&lt;/li&gt;\r\n	&lt;li&gt;Our email address is &lt;a href=&quot;mailto:peta_service@rogersfamilyco.com&quot;&gt;peta_service@rogersfamilyco.com&lt;/a&gt;.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n');
