INSERT INTO `product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES
(453, 1, 'Morning Birdsong Breakfast Blend', '&lt;p&gt;&lt;align=left&gt;&lt;b&gt;&lt;u&gt;Coffee Characteristics&lt;/u&gt;&lt;/b&gt;&lt;br /&gt;\r\nA mild roast, perfectly blended to yield a delicious, satisfying coffee. 100% certified organic and shade-grown. 12 oz. bag. &lt;eol&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;eol&gt;&lt;b&gt;Roast:&lt;/b&gt; &lt;img align=&quot;middle&quot; src=&quot;../files/images/roast_reg.gif&quot; /&gt;&lt;br /&gt;\r\n&lt;eol&gt;&lt;br /&gt;\r\n&lt;eol&gt;&lt;a href=&quot;/pages.php?pageid=7&quot;&gt;Learn more about our roast levels...&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Notes on Ground Coffee:&lt;/b&gt;&amp;nbsp; If you choose ground coffee, we''ll grind it &lt;eol&gt;to a medium-fine ground that works best for automatic drip brewers. If you''d like your coffee ground in another way, please note this in the customer notes section during checkout.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Gifts:&lt;/b&gt;&amp;nbsp; If this is intended as a gift, you can customize a brief gift message during checkout.&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/align=left&gt;&lt;/p&gt;\r\n', '', '', 'morning birdsong, breakfast blend, light roast, 3514'),
(457, 1, 'Flying Free French Roast - 2 lb. Value Size Bag', '&lt;align=left&gt;&lt;b&gt;&lt;u&gt;Coffee Characteristics&lt;/u&gt;&lt;/b&gt;&lt;br /&gt;\r\nWe roast this longer, turning the beans almost black to bring the natural oils out for an intense, caramelized taste. 100% certified organic and shade-grown. 2 lb. value size bag. &lt;eol&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;eol&gt;&lt;b&gt;Roast:&lt;/b&gt; &lt;img align=&quot;middle&quot; src=&quot;../files/images/roast_french.gif&quot; /&gt;&lt;br /&gt;\r\n&lt;eol&gt;&lt;br /&gt;\r\n&lt;eol&gt;&lt;a href=&quot;/pages.php?pageid=7&quot;&gt;Learn more about our roast levels...&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Notes on Ground Coffee:&lt;/b&gt;&amp;nbsp; If you choose ground coffee, we''ll grind it &lt;eol&gt;to a medium-fine ground that works best for automatic drip brewers. If you''d like your coffee ground in another way, please note this in the customer notes section during checkout.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Gifts:&lt;/b&gt;&amp;nbsp; If this is intended as a gift, you can customize a brief gift message during checkout.&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/align=left&gt;', '', '', 'flying free french roast, bulk coffee, organic coffee, shade grown coffee, 28052'),
(446, 1, 'Hand-painted, Botanist Mug - Coffea Arabica', 'Reminiscent of an old-style sketch in a botanist''s field journal, this beautifully, hand-painted stoneware mug depicts the 3 stages of the coffee lifecycle - the white flower, the red cherry, and the roasted coffee beans.  "Coffea arabica," the scientific name for coffee, is spelled out along the bottom in cursive.<br><br>Manufactured by <a href="http://www.hartstonepottery.com" target="blank">Hartstone Pottery Inc.</a>, all pottery is made and hand-painted in the USA. and each mug is truly one-of-a-kind.<br><br>Paired with PETA Coffee, this mug makes a great gift!<br><br>This is microwave, oven, and dishwasher-safe stoneware.  It''s produced to California code for lead content with a lead-free and cadmium-free, based glaze.<br><br>About stoneware:  stoneware is a hard strong and vitrified ware, usually fired above 2100 degrees F, that contains a high percentage of clay (usually 90%) and a low percentage of non clay materials. Due to the make up of the clay and high firing temperature stoneware is a dense, strong and durable ceramic that is especially appropriate for functional ware because it stands up well to constant use and frequent cleaning. Stoneware is dishwasher, microwave, freezer and oven proof.', '', '', 'mugs, 0295'),
(456, 1, 'No Ruffled Feathers Decaf - 2 lb. Value Size Bag', '<Align=left><b><u>Coffee Characteristics</u></b><br>This rich, aromatic decaf is the perfect way to start your morning. 100% certified organic and shade-grown. Naturally decaffeinated using our <a href="/pages.php?pageid=21">water method.</a>  2 lb. value size bag.   <EOL><br><br>     <EOL><b>Roast:</b>  <img src="../files/images/roast_reg.gif" align="center"> <br>     <EOL><br>     <EOL><a href="/pages.php?pageid=7">Learn more about our roast levels...</a><br><br><b>Notes on Ground Coffee:</b>&nbsp; If you choose ground coffee, we''ll grind it      <EOL>to a medium-fine ground that works best for automatic drip brewers.  If you''d like your coffee ground in another way, please note this in the customer notes section during checkout.<br><br><b>Gifts:</b>&nbsp; If this is intended as a gift, you can customize a brief gift message during checkout.', '', '', 'No ruffled feathers decaf, bulk coffee, decaf coffee, organic coffee, shade grown coffee, 28070'),
(454, 1, 'No Ruffled Feathers Decaf', '&lt;p&gt;&lt;align=left&gt;&lt;b&gt;&lt;u&gt;Coffee Characteristics&lt;/u&gt;&lt;/b&gt;&lt;br /&gt;\r\nThis rich, aromatic decaf is the perfect way to start your morning. 100% certified organic and shade-grown. Naturally decaffeinated using our &lt;a href=&quot;/pages.php?pageid=21&quot;&gt;water method.&lt;/a&gt; 12 oz. bag. &lt;eol&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;eol&gt;&lt;b&gt;Roast:&lt;/b&gt; &lt;img align=&quot;middle&quot; src=&quot;../files/images/roast_reg.gif&quot; /&gt;&lt;br /&gt;\r\n&lt;eol&gt;&lt;br /&gt;\r\n&lt;eol&gt;&lt;a href=&quot;/pages.php?pageid=7&quot;&gt;Learn more about our roast levels...&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Notes on Ground Coffee:&lt;/b&gt;&amp;nbsp; If you choose ground coffee, we''ll grind it &lt;eol&gt;to a medium-fine ground that works best for automatic drip brewers. If you''d like your coffee ground in another way, please note this in the customer notes section during checkout.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Gifts:&lt;/b&gt;&amp;nbsp; If this is intended as a gift, you can customize a brief gift message during checkout.&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/align=left&gt;&lt;/p&gt;\r\n', '', '', 'decaf coffee, no ruffled feathers, swiss water process, 3570'),
(455, 1, 'Morning Birdsong Breakfast Blend - 2 lb. Value Size Bag', '<Align=left><b><u>Coffee Characteristics</u></b><br>A mild roast, perfectly blended to yield a delicious, satisfying coffee. 100% certified organic and shade-grown. 2 lb. value size bag.   <EOL><br><br>     <EOL><b>Roast:</b>  <img src="../files/images/roast_reg.gif" align="center"> <br>     <EOL><br>     <EOL><a href="/pages.php?pageid=7">Learn more about our roast levels...</a><br><br><b>Notes on Ground Coffee:</b>&nbsp; If you choose ground coffee, we''ll grind it      <EOL>to a medium-fine ground that works best for automatic drip brewers.  If you''d like your coffee ground in another way, please note this in the customer notes section during checkout.<br><br><b>Gifts:</b>&nbsp; If this is intended as a gift, you can customize a brief gift message during checkout.', '', '', 'Morning Birdsong breakfast blend, bulk size, organic coffee, shade grown coffee, 28014'),
(452, 1, 'Flying Free French Roast', '&lt;p&gt;&lt;align=left&gt;&lt;b&gt;&lt;u&gt;Coffee Characteristics&lt;/u&gt;&lt;/b&gt;&lt;br /&gt;\r\nWe roast this longer, turning the beans almost black to bring the natural oils out for an intense, caramelized taste. 100% certified organic and shade-grown. 12 oz. bag. &lt;eol&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;eol&gt;&lt;b&gt;Roast:&lt;/b&gt; &lt;img align=&quot;middle&quot; src=&quot;../files/images/roast_french.gif&quot; /&gt;&lt;br /&gt;\r\n&lt;eol&gt;&lt;br /&gt;\r\n&lt;eol&gt;&lt;a href=&quot;/pages.php?pageid=7&quot;&gt;Learn more about our roast levels...&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Notes on Ground Coffee:&lt;/b&gt;&amp;nbsp; If you choose ground coffee, we''ll grind it &lt;eol&gt;to a medium-fine ground that works best for automatic drip brewers. If you''d like your coffee ground in another way, please note this in the customer notes section during checkout.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;b&gt;Gifts:&lt;/b&gt;&amp;nbsp; If this is intended as a gift, you can customize a brief gift message during checkout.&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/align=left&gt;&lt;/p&gt;\r\n', '', '', 'french roast, flying free, dark roast, 3552'),
(451, 1, 'PETA Coffee Gift Basket', 'Perfect for the holidays, birthdays, Father''s Day, Mother''s Day, or for saying "Thank-you," our PETA Coffee Gift Basket makes a truly thoughtful gift that you know will be appreciated! This sturdy, wood gift basket is wrapped in a cloud of cellophane and tied with a big bow.  <EOL><br>   <EOL><br>    <EOL>Includes 3 whole bean coffees:    <EOL><ul>   <EOL><li>12 oz. Flying Free French Roast</li>    <EOL><li>12 oz. Morning Birdsong Breakfast Blend</li>   <EOL><li>12 oz. No Ruffled Feathers Decaf</li>   <EOL><li>Blue PETA logo mug</li>  <EOL><li>$5 Gift Certificate on any product on our online store</li></ul>   <EOL><br>  <EOL><b>Gift Notes:</b>  You can customize a brief gift message during checkout.', '', '', 'gift, coffee basket, 11140'),
(450, 1, 'Capresso Cool Grind Blade Grinder', '&lt;p&gt;Best suitable for drip coffee makers and percolators, this blade grinder also works for spices and herbs. The large stainless steel grinding chamber reduces heat build-up to preserve more aroma. &lt;eol&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;&lt;eol&gt;\r\n	&lt;li&gt;Available in black color only.&lt;/li&gt;\r\n	&lt;eol&gt;\r\n	&lt;li&gt;Stainless steel blade and beaker low heat build-up and easy cleaning.&lt;/li&gt;\r\n	&lt;eol&gt;\r\n	&lt;li&gt;Fast stopping action (only one second) for maximum safety.&lt;/li&gt;\r\n	&lt;eol&gt;\r\n	&lt;li&gt;Large capacity for more than 15 cups of coffee.&lt;/li&gt;\r\n	&lt;eol&gt;\r\n	&lt;li&gt;Pulse action lets you control fineness of grind.&lt;/li&gt;\r\n	&lt;eol&gt;\r\n	&lt;li&gt;Clear see-through safety lid.&lt;/li&gt;\r\n	&lt;eol&gt;\r\n	&lt;li&gt;Recessed cord storage in base of grinder.&lt;/li&gt;\r\n	&lt;eol&gt;\r\n	&lt;li&gt;Product Dimensions: 4.00&quot; x 4.00&quot; x 8.00&quot;&lt;/li&gt;\r\n	&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;&lt;/eol&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n', '', '', 'capresso coffee grinder, coffee and spice grinder, 1542'),
(448, 1, 'Melitta, Unbleached, #4 Cone Filters - 40 Count', 'Melitta "Natural Brown" number 4 filters fit all coffeemakers that have a number 4 filter cone. These natural brown filters are made from unbleached pulp which helps keep water runoff free of contaminants.', '', '', 'coffee filters, melitta, 9434'),
(449, 1, 'Melitta, Unbleached, #6 Cone Filters - 40 Count', 'Melitta "Natural Brown" number 6 filters fit all coffeemakers that have a number 6 filter cone. These natural brown filters are made from unbleached pulp which helps keep water runoff free of contaminants.', '', '', 'coffee filters, melitta, 9437'),
(447, 1, 'Melitta, Unbleached, #2 Cone Filters - 40 Count', '&lt;p&gt;Melitta &quot;Natural Brown&quot; number 2 filters fit all coffeemakers that have a number 2 filter cone. These natural brown filters are made from unbleached pulp which helps keep water runoff free of contaminants.&lt;/p&gt;\r\n', '', '', 'coffee filters, melitta, 9432');
