(790, 0, 'welcome', 'welcome_module', 'a:1:{i:1;a:5:{s:11:"description";a:1:{i:1;s:2098:"&lt;div&gt;&lt;img alt=&quot;&quot; src=&quot;http://72.32.35.132/image/data/shade_grown_coffee_birds.jpg&quot; style=&quot;float:left; margin-right:10px; width: 335px; height: 312px;&quot; /&gt;\r\n&lt;h3&gt;PETA Cruelty Free Coffee&lt;/h3&gt;\r\n\r\n&lt;p&gt;100% organic &amp;amp; shade grown, PETA Coffee is grown on farms where no chemicals are used that might harm animals or people. It also protects migratory and native bird habitats from deforestation in the tropical highlands.&lt;/p&gt;\r\n\r\n&lt;p&gt;25% of all proceeds are donated to PETA''s &quot;Flying Free Campaign&quot;. Your purchase will help to educate the public about the illegal cage bird trade and why we shouldn''t keep birds as pets.&lt;/p&gt;\r\n\r\n&lt;p&gt;Beast of Burden Free - no animals were used in the production or harvesting of PETA Cruelty-Free Coffee.&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p&gt;Above: nest in an organic coffee tree on a PETA Coffee farm.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://72.32.35.132/image/data/freeshipping50.jpg&quot; style=&quot;width: 296px; height: 135px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://72.32.35.132/image/data/usda_certified.gif&quot; style=&quot;width: 50px; height: 50px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;font face=&quot;Arial&quot; size=&quot;2&quot;&gt;&lt;b&gt;Did You Know?&lt;/b&gt;&lt;/font&gt; &lt;font face=&quot;Arial&quot; size=&quot;2&quot;&gt;Shade grown and organic coffee beans yield a more complex and flavorful cup than regular coffees. Try some for yourself today! &lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://72.32.35.132/image/data/Quetzel_Bird.jpg&quot; style=&quot;width: 225px; height: 225px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Why Shop with Us? Support PETA! Loyalty points. High $ value discounts. Free shipping $50 or more. Never run out of coffee with PETA Coffee Club!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://petacoffee.oc1551/image/data/home/peta_coffee_club_logo.jpg&quot; style=&quot;width: 342px; height: 120px;&quot; /&gt;&lt;/p&gt;\r\n";}s:9:"layout_id";s:1:"1";s:8:"position";s:11:"content_top";s:6:"status";s:1:"0";s:10:"sort_order";s:1:"1";}}', 1),
